import React, { useState } from 'react';

function UserTable({ users, onDelete, onUpdate }) {
  const [editUserId, setEditUserId] = useState(null);
  const [formData, setFormData] = useState({});

  const [currentPage, setCurrentPage] = useState(1);
  const usersPerPage = 10;

  const indexOfLast = currentPage * usersPerPage;
  const indexOfFirst = indexOfLast - usersPerPage;
  const currentUsers = users.slice(indexOfFirst, indexOfLast);
  const totalPages = Math.ceil(users.length / usersPerPage);

  const handleEditClick = (user) => {
    setEditUserId(user.userId);
    setFormData({ ...user });
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = () => {
    onUpdate(formData);
    setEditUserId(null);
  };

  const handleCancel = () => {
    setEditUserId(null);
    setFormData({});
  };

  const handlePrevious = () => {
    if (currentPage > 1) setCurrentPage(prev => prev - 1);
  };

  const handleNext = () => {
    if (currentPage < totalPages) setCurrentPage(prev => prev + 1);
  };

  return (
    <div>
      <table className="table-custom">
        <thead>
          <tr>
            <th>ID</th><th>Nombre</th><th>Email</th><th>Contraseña</th><th>Rol</th><th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {currentUsers.map(user => (
            editUserId === user.userId ? (
              <tr key={user.userId}>
                <td>{user.userId}</td>
                <td><input name="name" value={formData.name || ''} onChange={handleChange} /></td>
                <td><input name="email" value={formData.email || ''} onChange={handleChange} /></td>
                <td><input name="password" value={formData.password || ''} onChange={handleChange} /></td>
                <td>
                  <select name="role" value={formData.role || ''} onChange={handleChange}>
                    <option value="duenio">Dueño</option>
                    <option value="asistente">Asistente</option>
                    <option value="veterinario">Veterinario</option>
                  </select>
                </td>
                <td>
                  <button className="table-btn" onClick={handleSubmit}>Guardar</button>
                  <button className="table-btn delete" onClick={handleCancel}>Cancelar</button>
                </td>
              </tr>
            ) : (
              <tr key={user.userId}>
                <td>{user.userId}</td>
                <td>{user.name}</td>
                <td>{user.email}</td>
                <td>{user.password}</td>
                <td>{user.role}</td>
                <td>
                  <button className="table-btn" onClick={() => handleEditClick(user)}>Editar</button>
                  <button className="table-btn delete" onClick={() => onDelete(user.userId)}>Eliminar</button>
                </td>
              </tr>
            )
          ))}
        </tbody>
      </table>

      {totalPages > 1 && (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', gap: '1rem', marginTop: '1rem' }}>
          <button className="table-btn" onClick={handlePrevious} disabled={currentPage === 1}>Anterior</button>
          <span>Página {currentPage} de {totalPages}</span>
          <button className="table-btn" onClick={handleNext} disabled={currentPage === totalPages}>Siguiente</button>
        </div>
      )}
    </div>
  );
}

export default UserTable;
